import React, { Component } from 'react';

class Frist extends Component {
    state = {}
    render() {

        function click() {
            console.log("good");
            alert
        }
        return (
            <div>

                <h1>Hello,react world!</h1>
                <h2>It is {new Date().toLocaleString()}.</h2>
                <button onClick={click}>click me!</button>
            </div>
        );
    }
}

export default Frist;
